const Pages  = (props) => {
    return <li><a href="/}"><button>Home</button></a></li>
}



const NavBar = (props) => {
    const pages = props.pages

    return (
        <div>
            <nav>
                <ul>
                   {pages}
                </ul>
            </nav>
        </div>
    )
};

export default NavBar;
